<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Webpage Screenshot</title>
</head>
<body>
  <h1>Webpage Screenshot</h1>
  <p>Taking screenshot...</p>
</body>
</html>
